import Image from "./";
import Image1 from "./brand.jpeg";
import './logo.css';

function Logo() {
    return (
        <div className="brandhub_header">

        <img src={Image} alt="logo not found" />
        <img src={Image1} className="brand_name" alt="brand name not found" />

    </div>
    );
}

export default Logo;
